// Imports
    // Librarys
import axios from "axios";
import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { BloqueCalendario } from "../components/BloqueCalendario";
import { BloqueHeader } from "../components/BloqueHeader";
import { Caracteristicas } from "../components/Caracteristicas";
import { DatosUbicacion } from "../components/DatosUbicacion";
import { Descripcion } from "../components/Descripcion";
import { Footer } from "../components/Footer";
import { Header } from "../components/Header";
import ImageGallery from "../components/ImageGallery";
import ImageGalleryDesktop from "../components/ImageGalleryDesktop";
import { Politicas } from "../components/Politicas";
import product from "../jsons/product.json"
// Styles
import "./styles/productStyle.css"

// Component 
const Productos = () => {

    const [data, setData] = useState(null);
    const { id } = useParams();

    console.log(id);

    useEffect(() => {
      axios.get(`http://localhost:8080/productos/${id}`)
        .then(function (response) {
          setData(response.data);
        })
        .catch(function (error) {
          console.log(error);
        });
    }, [id]);

    // if (!data) {
    //     return <div>Cargando...</div>;
    //   }

      console.log(data);

    return(
        <React.Fragment>
            <Header />
                <section>
                    <BloqueHeader object={data}/>
                    <DatosUbicacion />
                    <ImageGalleryDesktop object={product}/>
                    <ImageGallery nameClass={"mobile"} object={product}/>
                    <Descripcion />
                    <Caracteristicas />
                    <BloqueCalendario />

                    <div>
                        <p>Mapa</p>
                    </div>

                    <Politicas />
                </section>
            <Footer />
        </React.Fragment>
    )
}

// Export
export {Productos};
